import './Tables.scss';
import schedule from '../../../data/Schedule.json';

export const Tables = () => {
// const isMovile = true;
// const isDesktop = true;
// const dayItem = []
const timeArr = ["9:00", "10:00", "11:00", "12:00", "13:00", "14:00", "15:00", "16:00","17:00", "18:00", "19:00", "20:00"]
  return (
      <div className="tables">
        <table>
                <thead>
                    <tr>
                        <th>Day</th>
                        {
                            timeArr.map(time => (
                                <th>time}</th>
                            ))
                        }
                        {/* <th>10:00</th>
                        <th>11:00</th>
                        <th>12:00</th>
                        <th>13:00</th>
                        <th>14:00</th>
                        <th>15:00</th>
                        <th>16:00</th>
                        <th>17:00</th>
                        <th>18:00</th>
                        <th>19:00</th>
                        <th>20:00</th> */}
                    </tr>
                </thead>
                <tbody>
                    {schedule.map((user) => (
                        <tr key={user.id}>
                            <td >{user.day}</td>
                            {Object.keys(user.plan).map((plan) => (
                                <td className="tables--border" key={plan}>{user.plan[plan]}</td>
                            ))}
                        </tr>
                    ))}
                </tbody>
            </table>
      </div>
  );
}
